    false,nt"url": null,nt"notes": "A comprehensive songbird monitoring program
    was conducted for 3 years (1995 to 1997) at the San Luis National Wildlife  Refuge
    (SLNWR) in Merced County California. Efforts were concentrated primarily in riparian
    habitats and sloughs along  the San Joaquin River and, to a lesser extent, in nearby
    grasslands. Results suggest that the SLNWR supports a rich and  diverse bird community
    with an unusually complete riparian bird community. Of note are seemingly healthy
    populations of  Bewick's Wren, Black-headed Grosbeak, Blue Grosbeak, Common Yellowthroat,
    Lesser Nighthawk, Loggerhead Shrike  and Modesto Song Sparrows. Documentation of
    some of these species required a more adaptable protocol than existing  recognized
    monitoring methods. Many other species of interest, including Yellow Warbler, Warbling
    Vireo and Willow  Flycatcher, were documented using the area as a stopover sight
    during fall and spring migrations.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
